function init(){console.log("Static Assets Template - App initialized");setupEventListeners();loadData()}function setupEventListeners(){const buttons=document.querySelectorAll(".button");buttons.forEach(button=>{button.addEventListener("click",handleButtonClick)});const forms=document.querySelectorAll("form");forms.forEach(form=>{form.addEventListener("submit",handleFormSubmit)})}function handleButtonClick(event){event.preventDefault();const button=event.target;console.log("Button clicked:",button.textContent);showNotification("Button clicked successfully!")}function handleFormSubmit(event){event.preventDefault();const form=event.target;const formData=new FormData(form);console.log("Form submitted:",Object.fromEntries(formData));showNotification("Form submitted successfully!")}async function loadData(){try{console.log("Data loaded")}catch(error){console.error("Error loading data:",error)}}function showNotification(message){const notification=document.createElement("div");notification.className="notification";notification.textContent=message;notification.style.cssText=`
        position: fixed;
        top: 20px;
        right: 20px;
        background: #2ecc71;
        color: white;
        padding: 15px 20px;
        border-radius: 4px;
        box-shadow: 0 2px 8px rgba(0,0,0,0.2);
        z-index: 1000;
    `;document.body.appendChild(notification);setTimeout(()=>{notification.remove()},3e3)}if(document.readyState==="loading"){document.addEventListener("DOMContentLoaded",init)}else{init()}